import { Component } from "react";
import "/Nstyles.css";

class Navbar extends Component {
    render() {
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">CCH</h1>

                <ul className="nav-menu">
                    <li>
                        <Link>
                        <i class="fa-solid fa-house-user"></i>Home
                        </Link>
                    </li>
                </ul>
            </nav>
        )
    }
}

